import React, { useState, useEffect } from 'react';
import { useParams } from "react-router-dom";
import axios from 'axios';

const DetailedPastProject = () => {
  const [listing, setListing] = useState(null);
  const [teamMembers, setTeamMembers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const { id } = useParams();

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const response = await axios.get(`http://localhost:5500/past-projects/browse/${id}`);
        setListing(response.data[0][0]);
        setTeamMembers(response.data[1]);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(error);
        setLoading(false);
      }
    };

    fetchData();
  }, [id]);

  console.log(listing);
  console.log(teamMembers);

  // Detailed listing information
  return (
    <div>
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>Error fetching data</p>
      ) : listing ? (
        <div>
          <h1>{listing.listingTitle}</h1>
          {/* Add more detailed information here */}
          {/* Iterate through team members and display their information */}
          {teamMembers.map(member => (
            <div key={member.memberID}>
              <h3>{member.roleTitle}: {member.firstName} {member.lastName}</h3>
              <p>{member.roleDescription}</p>
            </div>
          ))}
        </div>
      ) : (
        <p>Listing not found</p>
      )}
    </div>
  );
};

export default DetailedPastProject;
